import React from 'react';
import {
  Button,
  FormControl,
  Grid,
  InputLabel,
  MenuItem,
  Paper,
  Select,
  TextField,
  Typography,
} from '@material-ui/core';

import CloudUploadIcon from '@material-ui/icons/CloudUpload';
import { useStyles } from './css/main';

export default function Register() {
  const classes = useStyles();

  /* doSubmit = async () => {
    const { data } = this.state;
  }; */

  const [age, setAge] = React.useState('');

  const handleChange = (event) => {
    setAge(event.target.value);
  };

  return (
    <Grid container alignItems="flex-end" justify="center">
      <Grid item className={classes.registerPaperClass}>
        <Paper elevation={4}>
          <form
            // onSubmit={this.handleSubmit}
            method="POST"
            autoComplete="off"
            className={classes.form}
          >
            <Typography variant="h6" className={classes.root}>
              נא הירשם כדי להיות חלק ממסעדה!
            </Typography>

            <TextField id="outlined-basic" label="שם פרטי" variant="outlined" />
            <TextField
              id="outlined-basic"
              label="שם משפחה"
              variant="outlined"
            />
            <br />
            <br />
            <TextField id="outlined-basic" label="סיסמה" variant="outlined" />
            <TextField id="outlined-basic" label="אימייל" variant="outlined" />
            <br />
            {/* DROP DOWN SELECT/OPTION */}

            <FormControl variant="outlined" className={classes.formControl}>
              <InputLabel id="demo-simple-select-outlined-label">
                DORON
              </InputLabel>
              <Select
                labelId="demo-simple-select-outlined-label"
                id="demo-simple-select-outlined"
                value={age}
                onChange={handleChange}
                label="Age"
              >
                <MenuItem value={true}>כן</MenuItem>
                <MenuItem value={false}>לא</MenuItem>
              </Select>
            </FormControl>
            <br />

            <Button
              variant="outlined"
              color="default"
              className={classes.register_button}
              startIcon={<CloudUploadIcon />}
            >
              העלה תמונת פרופיל
            </Button>
          </form>
        </Paper>
      </Grid>
    </Grid>
  );
}
